import Link from "next/link";
const NaveBar = () => (
  <div className="container">

  <nav>
    <div className="conten-nav ">
      <Link href="/create">
        <button className="btn"> Create </button>
      </Link>

      <button className="btn"> Delete </button>
    </div>
  </nav>
  
  </div>
);
export default NaveBar;
